@dev Mints a ZK Badge based on a Sismo Connect response
Each appId is mapped to a ZK Badge configuration.
the vaultId provided in the response must not have minted a ZK Badge for this appId yet.
The vaultId is used to prevent double spending of a ZK Badge for a specific appId.
@param responseBytes Response from Sismo Connect in a bytes format
@param to Address of the receiver of the ZK Badge
@param tokenId TokenId of the ZK Badge to mint

@dev Registers a ZK Badge configuration
The function can only be called by the super admin.
The config can be registered one time only.
It is then possible to update the config if you are the owner for this config.
This config allows to setup:
- the uri of the ZK Badge
- the Sismo Connect configuration
- the auths and claims required to mint the ZK Badge
- the owner of the ZK Badge configuration
- the tokenId of the ZK Badge
@param appId id of the Sismo Connect App from which the proofs are required
@param isImpersonationMode if True, the ZK Badge can be minted thanks to impersonated proofs
@param tokenURI uri of the ZK Badge metadata
@param authRequests list of dataSource ownerships required to mint the ZK Badge
@param claimRequests list of group memberships required to mint the ZK Badge
@param owner owner of the ZK Badge configuration
@param tokenId tokenId of the ZK Badge

