@title ZK Badge Minter contract
@author Sismo
@notice This contract is an upgrade of the previous Badges contract.
It allows to mint ERC1155 ZK Badges based on proofs made through Sismo Connect.
The Legacy behavior of this contract is still functioning, but it is now only possible to mint ZK Badges based on Sismo Connect proofs.
